[include mainsail.cfg]
[include macros.cfg]
[include timelapse.cfg]
[include KAMP_Settings.cfg]
#[include options/thermistor/thermistor.cfg]
[include options/lcd/*.cfg]
[include options/probe/beacon.cfg]
[include options/led/hotend.cfg]
[include options/fans/fans.cfg]

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f103xe_32FFDA054747393912641657-if00
restart_method: command

[mcu extra_mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f103xe_50FF6D068367515517180467-if00
restart_method: command

#[mcu expander]
#serial: /dev/serial/by-id/usb-Klipper_stm32f042x6_11002100115330374E333320-if00
#restart_method: command

[neopixel hotend_rgb]
pin: extra_mcu:PA10
chain_count: 1
color_order: GRB
initial_RED: 0.01
initial_GREEN: 0.01
initial_BLUE: 0.01
initial_WHITE: 0.1

[printer]
kinematics: corexy
max_velocity: 500
max_accel: 25000
minimum_cruise_ratio: 0.5
max_z_velocity: 20
max_z_accel: 500
square_corner_velocity: 5.0

# X STEPPER (LEFT)
[stepper_x]
step_pin: PE2
dir_pin: !PE0
enable_pin: !PE3
rotation_distance: 39.758
microsteps: 64
full_steps_per_rotation: 200
endstop_pin: tmc2209_stepper_x:virtual_endstop
position_min: -15
position_endstop: 355
position_max: 370
homing_speed: 30
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PE1
interpolate: false
run_current: 1.061
sense_resistor: 0.150
stealthchop_threshold: 0
uart_address: 3
driver_sgthrs: 75
diag_pin: PE15
driver_TBL: 1
driver_TOFF: 3
driver_HSTRT: 7
driver_HEND: 5

# Y STEPPER (RIGHT)
[stepper_y]
step_pin: PB8
dir_pin: PB6
enable_pin: !PB9
rotation_distance: 39.720
microsteps: 64
full_steps_per_rotation: 200
endstop_pin: tmc2209_stepper_y:virtual_endstop
position_min: -15
position_endstop: 364
position_max: 380
homing_speed: 30
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: PB7
interpolate: false
run_current: 1.061
sense_resistor: 0.150
stealthchop_threshold: 0
uart_address: 3
driver_sgthrs: 85
diag_pin: PE13
driver_TBL: 1
driver_TOFF: 3
driver_HSTRT: 7
driver_HEND: 5

# Z STEPPER - BACK-LEFT (Motherboard Z3)
[stepper_z]
step_pin: PC0
dir_pin: PE5
enable_pin: !PC1
rotation_distance: 40
gear_ratio: 80:12
microsteps: 64
endstop_pin: probe:z_virtual_endstop
position_max: 347
position_min: -5
homing_speed: 15.0
homing_retract_dist: 5.0
homing_retract_speed: 15.0
second_homing_speed: 10.0

[tmc2209 stepper_z]
uart_pin: PE6
interpolate: false
run_current: 0.566
sense_resistor: 0.150
stealthchop_threshold: 999999
uart_address: 3

# Z1 STEPPER - BACK-RIGHT (Motherboard Z1)
[stepper_z1]
step_pin: PD3
dir_pin: !PD1
enable_pin: !PD4
rotation_distance: 40
gear_ratio: 80:12
microsteps: 64

[tmc2209 stepper_z1]
uart_pin: PD2
interpolate: false
run_current: 0.566
sense_resistor: 0.150
stealthchop_threshold: 999999
uart_address: 3

# Z2 STEPPER - FRONT-LEFT (Motherboard Z2)
[stepper_z2]
step_pin: PD7
dir_pin: PD5
enable_pin: !PB5
rotation_distance: 40
gear_ratio: 80:12
microsteps: 64

[tmc2209 stepper_z2]
uart_pin: PD6
interpolate: false
run_current: 0.566
sense_resistor: 0.150
stealthchop_threshold: 999999
uart_address: 3

# Z3 STEPPER - FRONT-RIGHT (Motherboard Z4)
[stepper_z3]
step_pin: PD11
dir_pin: !PD9
enable_pin: !PD12
rotation_distance: 40
gear_ratio: 80:12
microsteps: 64

[tmc2209 stepper_z3]
uart_pin: PD10
interpolate: false
run_current: 0.566
sense_resistor: 0.150
stealthchop_threshold: 999999
uart_address: 3

# EXTRUDER THERMISTOR
[thermistor my_thermistor_e]
temperature1: 25
resistance1: 110000
temperature2: 100
resistance2: 7008
temperature3: 220
resistance3: 435

# EXTRUDER
[extruder]
step_pin: extra_mcu:PA8
dir_pin: extra_mcu:PB8
enable_pin: !extra_mcu:PB11
rotation_distance: 6.709
microsteps: 64
full_steps_per_rotation: 200
nozzle_diameter: 0.400
filament_diameter: 1.75
max_extrude_only_distance: 101
heater_pin: extra_mcu:PB9
sensor_type: my_thermistor_e
pullup_resistor: 11500
sensor_pin: extra_mcu:PA5
min_temp: 5
max_temp: 305
max_power: 1.0
min_extrude_temp: 150
control: pid
pid_kp: 29.569
pid_ki: 2.899
pid_kd: 75.401
pressure_advance: 0.025
pressure_advance_smooth_time: 0.035
max_extrude_cross_section: 10

[tmc2209 extruder]
uart_pin: extra_mcu:PB10
interpolate: false
run_current: 0.8
uart_address: 3
sense_resistor: 0.150
driver_TBL: 1
driver_TOFF: 3
driver_HSTRT: 7
driver_HEND: 8

[verify_heater extruder]
max_error: 120
check_gain_time: 30
hysteresis: 5
heating_gain: 2

[firmware_retraction]
retract_length: 0
retract_speed: 20
unretract_extra_length: 0
unretract_speed: 10

# FILAMENT SENSOR
[filament_motion_sensor encoder_sensor]
switch_pin: PE9
detection_length: 6.0
extruder: extruder
pause_on_runout: false
runout_gcode:
    PAUSE
    M117 Filament encoder runout
insert_gcode:
    M117 Filament encoder inserted

# BED THERMISTOR
[thermistor my_thermistor]
temperature1: 25
resistance1: 100000
temperature2: 50
resistance2: 18085.4
temperature3: 100
resistance3: 5362.6

# HEATED BED
[heater_bed]
heater_pin: PA0
sensor_type: my_thermistor
sensor_pin: PC5
max_power: 1.0
min_temp: 5
max_temp: 105
control: pid
pid_kp: 60.445
pid_ki: 2.600
pid_kd: 351.338
pwm_cycle_time: 0.01667

[verify_heater heater_bed]
max_error: 120
check_gain_time: 40
hysteresis: 5
heating_gain: 2

# MOTION
[gcode_arcs]
resolution: 1.0

[input_shaper]
damping_ratio_x: 0.063
damping_ratio_y: 0.062
shaper_type_x: ei
shaper_freq_x: 86.0
shaper_type_y: mzv
shaper_freq_y: 42.8

[skew_correction]

# LIGHTING
[led main_led]
white_pin: PA3
cycle_time: 0.010
hardware_pwm: false
initial_WHITE: 1.0

# SYSTEM MONITORING
[idle_timeout]
gcode: _IDLE_TIMEOUT
timeout: 600

[temperature_sensor mcu_temp]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

[temperature_sensor Host_temp]
sensor_type: temperature_host
min_temp: 0
max_temp: 110

[temperature_sensor Toolhead_Temp]
sensor_type: temperature_mcu
sensor_mcu: extra_mcu

# ADVANCED FEATURES
[pause_resume]

[exclude_object]

[adxl345]
cs_pin: extra_mcu:PB12

[resonance_tester]
accel_chip: beacon
probe_points: 175, 175, 30

[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
number_of_results_to_keep: 10
keep_raw_data: false
show_macros_in_webui: true
timeout: 600
measurements_chunk_size: 2
max_freq: 200
dpi: 300

[save_variables]
filename: ~/printer_data/config/saved_variables.cfg

